import data1 from "./Data/1.js";

const Result = () => {
  var indicator = Array(10).fill(0);
  console.log(data1);
  const newArray = data1.sort((a, b) => a[0] - b[0]);
  console.log(newArray);

  console.log(indicator);

  for (let i = 0; i < newArray.length - 1; i++) {
    var list = [];
    for (var j = newArray[i][0]; j <= newArray[i][0]; i++) {
      list.push(i);
    }
    console.log(list);
    // if (newArray[i + 1][0] < newArray[i][1]) {
    //   console.log("find it!");
    // } else {
    //   console.log("no overlap");
    // }
  }

  return <div>{data1}</div>;
};

export default Result;
